import React, { Component } from 'react';
import '../Projects.css'

class Projects extends Component {
  render() {
    return (
      <div style={{"width":"100%","height":"100%","position":"relative"}} uk-scrollspy="cls: uk-animation-slide-left-small; target: > div > .uk-card; delay: 500; repeat: true">
      <div className="skew" uk-grid uk-scrollspy="uk-animation-slide-fade; delay: 500; repeat: true">
        <div
          style={{"height":"80vh","backgroundColor":"#33466b"}}
          uk-grid uk-scrollspy="cls: uk-animation-slide-left-small; target: > div > .uk-card; delay: 500; repeat: true"
        >
          <div class="skew2 uk-column-1-2" uk-grid uk-scrollspy="cls: uk-animation-slide-left-small; target: > div > .uk-card; delay: 500; repeat: true">
            <div style={{"transform": "skewY(1.8deg)"}}></div>

            <div style={{"transform": "skewY(1.8deg)"}}></div>
          </div>
        </div>
      </div>

      <div class="uk-card uk-card-default uk-card-body" style={{"position":"absolute","width":"310px","height":"415px","backgroundColor":"#84a3ff", "marginLeft":"120px","marginTop":"20px"}}>

        <div style={{"text-align":"center","position":"relative","background":"rgba(0,0,0,0)","box-shadow":"0 0px 0px rgba(0,0,0,0)"}} class="uk-card uk-card-default uk-card-body">
            <img style={{"marginLeft":"10px","marginTop":"50px"}} src="pictures/me.jpg" width="50%" height="50%" alt="" uk-img/>
        </div>

      </div>

      <div style={{"marginTop":"50px","height":"400px"}} class="uk-card uk-card-default uk-card-body">
          <h3 class="uk-card-title">Brian Yu</h3>
          <p>Design</p>
          <p>Architecture</p>
          <p>Code</p>

      </div>

      </div>
    );
  }
}

export default Projects;
